import React, { useState } from "react";
import {
  Container,
  Typography,
  TextField,
  Button,
  FormControlLabel,
  Switch,
  Box,
  MenuItem,
} from "@mui/material";
import "./UploadForm.css";

const UploadForm = ({ onCancel, onUploadSuccess }) => {
  const [formData, setFormData] = useState({
    courseCode: "",
    courseTitle: "",
    primaryInstructor: "",
    secondaryInstructor: "",
    semester: "",
    year: "",
    description: "",
    link: "",
    tags: {
      assignments: false,
      books: false,
      endtermAssessments: false,
      lectureSlides: false,
      midtermAssessments: false,
      notes: false,
      programmingAssessments: false,
      quizzes: false,
      videoLectures: false,
      tutorials: false,
      miscellaneous: false,
    },
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleToggleTag = (tag) => {
    setFormData((prev) => ({
      ...prev,
      tags: { ...prev.tags, [tag]: !prev.tags[tag] },
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Simulate API call
      console.log("Submitting form data:", formData);
      onUploadSuccess();
    } catch (error) {
      console.error("Error uploading file:", error);
    }
  };

  return (
    <Container className="upload-form-container">
      <Typography variant="h5" className="upload-form-title">
        Add a new resource
      </Typography>
      <form onSubmit={handleSubmit}>
        {/* Course Details */}
        <Box className="upload-form-section">
          <TextField
            select
            label="Course Code *"
            name="courseCode"
            value={formData.courseCode}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
            placeholder="Select course code..."
          >
            {/* Add your dynamic options here */}
          </TextField>

          <TextField
            select
            label="Course Title *"
            name="courseTitle"
            value={formData.courseTitle}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
            placeholder="Select course title..."
          >
            {/* Add your dynamic options here */}
          </TextField>

          <TextField
            select
            label="Primary Instructor *"
            name="primaryInstructor"
            value={formData.primaryInstructor}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
            placeholder="Select instructor..."
          >
            {/* Add your dynamic options here */}
          </TextField>

          <TextField
            select
            label="Secondary Instructor (If applicable)"
            name="secondaryInstructor"
            value={formData.secondaryInstructor}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
          >
            {/* Add your dynamic options here */}
          </TextField>

          <TextField
            select
            label="Semester *"
            name="semester"
            value={formData.semester}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
          >
            {/* Add your dynamic options here */}
          </TextField>

          <TextField
            select
            label="Year *"
            name="year"
            value={formData.year}
            onChange={handleInputChange}
            fullWidth
            margin="normal"
          >
            {/* Add your dynamic options here */}
          </TextField>
        </Box>

        {/* Tags */}
        <Box className="upload-form-section">
          <Typography variant="h6" className="tags-title">
            Tags
          </Typography>
          {Object.keys(formData.tags).map((tag) => (
            <FormControlLabel
              key={tag}
              control={
                <Switch checked={formData.tags[tag]} onChange={() => handleToggleTag(tag)} />
              }
              label={tag.charAt(0).toUpperCase() + tag.slice(1).replace(/([A-Z])/g, " $1")}
              className="tag-switch"
              sx={{ color: "#ffffff" }}
            />
          ))}
        </Box>

        {/* Description and Link */}
        <Box className="upload-form-section">
          <TextField
            label="Description"
            name="description"
            value={formData.description}
            onChange={handleInputChange}
            multiline
            rows={3}
            fullWidth
          />
          <TextField
            label="Link *"
            name="link"
            value={formData.link}
            onChange={handleInputChange}
            fullWidth
          />
        </Box>

        {/* Buttons */}
        <Box className="upload-form-buttons">
          <Button variant="outlined" color="secondary" onClick={onCancel}>
            Cancel
          </Button>
          <Button variant="contained" color="primary" type="submit">
            Upload
          </Button>
        </Box>
      </form>
    </Container>
  );
};

export default UploadForm;
